import React from "react";

const ProgrammingSkills = ({ programming }) => {
    return (
        <li>
            <p>
                {programming.language} <span className={`programming-item ${programming.id}`}>{programming.rate}</span>
            </p>
        </li>
    )
}

export default ProgrammingSkills;
